# Utility functions to plot pie chart for data-types in the dataset

def autopct_format(values):
        def my_format(pct):
            total = sum(values)
            val = int(round(pct*total/100.0))
            return '{:.1f}%\n({v:d})'.format(pct, v=val)
        return my_format

def plot_datatype_pie_chart(dataframe):
    type_to_columns_dict = dataframe.columns.to_series().groupby(dataframe.dtypes).groups
    types_list = list(type_to_columns_dict.keys())

    type_to_fdCount_dict = dict.fromkeys(types_list)
    for key in types_list:
        type_to_fdCount_dict.update({key: len(type_to_columns_dict[key])})

    df = pd.DataFrame(type_to_fdCount_dict, index=['count']).transpose()

    fig, ax = plt.subplots(figsize=(4, 4))
    df.plot.pie(y='count', legend=False, ax=ax, autopct=autopct_format(df["count"]),
                explode=(0, 0.1, 0.2), shadow=True, startangle=0)
    plt.title("Datatype distribution for the dataset - {}".format(dataframe.attrs["name"]))
    buf = BytesIO()
    plt.savefig(buf, format='png')
    buf.seek(0)
    img_base64 = base64.b64encode(buf.read()).decode('utf-8')
    buf.close()
    plt.close()
    return img_base64

# Define a function to remove HTML tags from the input string.
def remove_html_tags(html_string):
    # Regular expression pattern to match text between HTML tags.
    pattern = re.compile(r'<.*?>')

    # Use regular expression to replace HTML tags with a space.
    cleaned_string = re.sub(pattern, ' ', html_string)

    # Unescape HTML entities and strip leading/trailing whitespace.
    cleaned_string = unescape(cleaned_string).strip()

    # Replace multiple spaces with a single space.
    cleaned_string = re.sub(r'\s+', ' ', cleaned_string)

    return cleaned_string

def clean_html_tags(description):
    # Parse the HTML content using BeautifulSoup
    description = str(description)
    description = description.replace('<br>', ' ')
    soup = BeautifulSoup(description, 'html.parser')
    # Extract text from the parsed content
    cleaned_description = ' '.join(soup.stripped_strings)
    # Remove extra whitespace
    #cleaned_description = ' '.join(cleaned_description.striped_strings)
    return str(cleaned_description) if len(str(cleaned_description)) > 0 else '-'

def product_document_creation(product_series):
    """
    Generate a metadata string for a given product, excluding 'ratingCount' and 'p_id'.

    Args:
    product_series (pd.Series): A Series containing product details.

    Returns:
    str: A formatted string representing the product's metadata.
    """
    # Convert the Series to a dictionary
    product_dict = product_series.to_dict()

    # Define keys to exclude from the product details
    exclude_keys = {'ratingCount', 'p_id'}

    # Create a list to hold each line of the product document
    document_lines = []

    # Loop through each key-value pair in the product dictionary
    for key, value in product_dict.items():
        if key == 'p_attributes':
            key = 'attributes'

        # Skip keys that are in the exclude_keys set
        if key in exclude_keys:
            continue

        # Format the value if it is the 'avg_rating' key
        if key == 'avg_rating':
            value = f"{value:.2f}"


        # Capitalize the key for readability and add the line to the document
        document_lines.append(f"{key.capitalize().replace('_', ' ')} : {value}")

    # Join the document lines into a single string with newline characters
    product_document = "\n".join(document_lines)

    return product_document

# Function to determine the gender from the product name
def determine_gender(name):
    name_lower = name.lower()
    if 'Women' in name:
        return 'Women'
    elif 'Men' in name:
        return 'Men'
    elif 'Girls' in name:
        return 'Girls'
    elif 'Boys' in name:
        return 'Boys'
    elif 'Unisex' in name:
        return 'Unisex'
    else:
        return 'Unknown'  # Default case if none of the keywords are found

