def similarity_search_results(query: str) -> pd.DataFrame():
    """
    Args:
      query:  query to perform similarity search

    Returns:
      df_output: dataframe with the results
    """
    docs = db.similarity_search(query)
    if len(docs) > 0:
      df_output = pd.DataFrame()
      for doc in docs:
        # Extract the string
        metadata_str = doc.metadata['metadata']
        # Replace nan with None for proper conversion
        metadata_str = metadata_str.replace('nan', 'None')
        # Convert the string to a dictionary
